import React from 'react';
import logo from './logo.svg';
import './App.css';
import About from "./Pages/About"
import Navbar from "./Components/NavBar/NavBar"
import Footer from "./Components/Footer/Footer"
import Home from "./Pages/Home"

import Portfolio from "./Pages/Portfolio"
import Contact from "./Pages/Contact"
import Skills from "./Pages/Skills"
import { BrowserRouter as Router, Route, Switch, Redirect } from "react-router-dom";


const pageStyle = {
  width: "100%",
  height: "400px",
  backgroundImage: "https://upload.wikimedia.org/wikipedia/commons/4/46/Curiosity_at_Work_on_Mars_%28Artist%27s_Concept%29.jpg"
};

function App() {


  const style = {
    backgroundImage: "url(" + "https://previews.123rf.com/images/apostrophe/apostrophe1510/apostrophe151000116/47454426-orange-yellow-background-with-vintage-grunge-background-texture-design-old-faded-paper-distressed-wo.jpg" +")",
    marginTop:"64px"
  }

  return (
    <Router>
    <div >
        <Navbar />
        <Switch>
          <main style={pageStyle} >
          <Route exact path="/" component={Home} />
          <Route exact path="/saved" component={About} />
          <Route exact path="/books/:id" component={Portfolio} />
          <Route exact path="/contact" component={Contact} />
          </main>
          <Footer/>
        </Switch>
    </div>
  </Router>
  );
}

export default App;
